description:
The Famous Five is the name of a series of childrens novels written by British author Enid Blyton. The first book, Five on a Treasure Island, was published in 1942.

The novels feature the adventures of a group of young children Julian, Dick, Anne and Georgina (George) and their dog Timothy. Blyton created several similar groups for her detective series, including The Secret Seven, The Adventurous Four (not to be confused with The Adventure Series) and Five Find-Outers, but the Famous Five is the best-known and most popular of these.

Six comic books created by Bernard DufossÃƒÂ© and scripted by Serge Rosenzweig and Rafael Carlo Marcello were released in France between 1982 and 1986, under the title Le Club des Cinq. Most of comic books in the series are based on Famous Five books created by Claude Voilier. The first three of these volumes have also been released in English, under the name The Famous Five.

